        [HttpPost]
        public IActionResult Index(svGeneralShipmentLabelSelectVM svGeneralShipmentLabelSelectVM)
        {
            svGeneralShipmentLabelSelectVM.ShipmentID = 0;
            var ShipmentID = new SqlParameter("@ShipmentID", svGeneralShipmentLabelSelectVM.ShipmentID);

            var FromName = new SqlParameter("@FromName", svGeneralShipmentLabelSelectVM.FromName ?? "");
            var ToName = new SqlParameter("@ToName", svGeneralShipmentLabelSelectVM.ToName ?? "");
            var TrackingNumber = new SqlParameter("@TrackingNumber", svGeneralShipmentLabelSelectVM.TrackingNumber ?? "");
            var FromDate = new SqlParameter("@FromDate", svGeneralShipmentLabelSelectVM.FromDate ?? "");
            var ToDate = new SqlParameter("@ToDate", svGeneralShipmentLabelSelectVM.ToDate ?? "");

            IEnumerable<svGeneralShipmentLabel> labelList = _db.svGeneralShipmentLabel
                        .FromSqlRaw("exec svGeneralShipmentLabelSelect @ShipmentID, @FromName, @ToName, @TrackingNumber, @FromDate, @ToDate",
                           ShipmentID, FromName, ToName, TrackingNumber, FromDate, ToDate)
                        .ToList();
            //if (labelList == null)
            //TempData["labelList"] = labelList;
            // HttpContext.Session.Set("labelList", svGeneralShipmentLabelSelectVM.LabelList);
            ViewBag.TotalPrice = labelList.Sum(x => x.FinalPostage);
            svGeneralShipmentLabelSelectVM.LabelList = labelList;
            return View(svGeneralShipmentLabelSelectVM);
        }
