        [HttpPost]
        public IActionResult Create(svGeneralShipmentLabelVM _svGeneralShipmentLabelVM)
        {
            string shipDate = Request.Form["Shipmentdate"];
            
            shipDate = shipDate.Replace("-", "/");
            DateTime dt = DateTime.Now;
            if (!string.IsNullOrEmpty(shipDate))
            {
                if (shipDate.Contains("-"))
                {
                    string[] array = shipDate.Split('-');
                    {
                        shipDate = array[2] + "-" + array[0] + "-" + array[1];
                        dt = Convert.ToDateTime(shipDate);
                    }
                }
                else if (shipDate.Contains("/"))
                {
                    string[] array = shipDate.Split('/');
                    {
                        shipDate = array[2] + "-" + array[0] + "-" + array[1];
                        dt = Convert.ToDateTime(shipDate);
                    }
